import React from "react";


function ticking(){
  const element = (
    <div>
      <h1>现在时间是：</h1>
      <h2>{new Date().toLocaleTimeString()}</h2>
    </div>
  );
  ReactDOM.render(
    element,
    document.getElementById('root')
  );
};
setInterval(ticking, 1000);
export default function Home() {
  return (
    <>
      <h2>Welcome to Garmin Dashboard</h2>
      <p>Time is {ticking()}</p>
      <p>Athlete name:</p>
      <p>Other info:</p>
      <img src="/finance-chart.jpg" width="100%" alt="finance chart"/>
    </>
  )
}
